import List from "./components/List/List";
import Expenses from "./components/Expenses/Expenses";
import NewExpense from "./components/Expenses/NewExpense/NewExpense";
import React from "react";

function App() {

  const expense= [
    {title:'Ak-47 : Case Hardened',amount:300,date: new Date(2023,5,16)},
    {title:'AWP:Dragon Lore',amount:15000,date: new Date(2023,5,16)},
    {title:'M4A1 : Desolate Space',amount:50,date: new Date(2023,5,16)}
  ]

  const raritySpecs= [
    {rarity:'mil-spec',hex:"333333"},
    {rarity:'classified',hex:"222222"}, 
    {rarity:'contraband',hex:"111111"},
  ]

  const addExpenseHandler = expense => {
    console.log(expense)
  }

  const clickCheckboxTrue = content => {
    console.log("Content: " +JSON.stringify(content))
  }

  return (
    <div>
      <NewExpense onAddExpense={addExpenseHandler}/>
      <Expenses array={expense}/>
      <p>-------------------------</p>
      <List array={raritySpecs} onCheckTrue={clickCheckboxTrue}></List>
    </div>
  );
}

export default App;
